app.directive('news', [function(){
  function link(scope, el, attr){
    el = el[0];
    scope.newsItems = [];

    scope.$watch('keywords', function(){
      if (!scope.data){return;}
      scope.newsItems = scope.data.series[0].spikes[0].news;
    });

    scope.$watch('curSpike', function(){
      if (!scope.curSpike){return;}
      for (var i = 0; i < scope.data.series[0].spikes.length; i++){
        if (scope.data.series[0].spikes[i].date_time === scope.curSpike){
          scope.newsItems = scope.data.series[0].spikes[i].news;
        }
      }
    },true);
  }


  return {
    link: link,
    restrict: 'E',
    scope: { data: '=', curSpike: '='},
    templateUrl: 'app/templates/news.html'
  };
}]);
app.directive('postsMultiple', function(){
  function link(scope, el, attr){
    el = el[0];
    var margin = {top: 50, right: 10, bottom: 100, left: 50},
      margin2 = {top: 330, right: 10, bottom: 20, left: 50};

    var width, height, height2, cW, cH;

    var svg = d3.select(el).append('svg');

    var x = d3.time.scale(),
        x2 = d3.time.scale(),
        y = d3.scale.linear(),
        y2 = d3.scale.linear();

    var format;

    var xAxis = d3.svg.axis().scale(x).orient("bottom"),
      xAxis2 = d3.svg.axis().scale(x2).orient("bottom"),
      yAxis = d3.svg.axis().scale(y).orient("left");

    var line = d3.svg.line()
      .interpolate("basis")
      .x(function(d) { return x(d.date_time);})
      .y(function(d) { return y(d.posts_count);});

    var line2 = d3.svg.line()
      .interpolate("basis")
      .x(function(d) { return x2(d.date_time);})
      .y(function(d) { return y2(d.posts_count);});

    var brush = d3.svg.brush()
      .x(x2)
      .on("brush", brushed);

    var focus = svg.append("g")
      .attr("class", "focus")
      .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

    var lineG = focus.selectAll(".series");

    var xAxisG = focus.append("g")
        .attr("class", "x axis");

    var yAxisG = focus.append("g")
        .attr("class", "y axis");

    var context = svg.append("g")
      .attr("class", "context")
      .attr("transform", "translate(" + margin2.left + "," + margin2.top + ")");

    var line2G = context.selectAll(".series");

    var xAxis2G = context.append("g")
        .attr("class", "x axis");

    var clip = svg.append("defs").append("clipPath")
      .attr("id", "clip-m")
      .append("rect");

    var rect = context.append("g")
        .attr("class", "x brush")
        .call(brush)
      .selectAll("rect");

    var arc = d3.svg.arc()
      .outerRadius(15 / 2)
      .startAngle(0)
      .endAngle(function(d, i) { return i ? -Math.PI : Math.PI; });

    scope.$watch(function(){ 
      cH = el.clientHeight;
      cW = el.clientWidth;

      width = cW - margin.left - margin.right;
      height = cH - margin.top - margin.bottom;
      height2 = cH - margin2.top - margin2.bottom;

      return cW + cH;
    }, resize);

    function resize(){
      //Resize SVG element
      svg
        .attr("width", cW)
        .attr("height", cH);

      clip
        .attr("width", width)
        .attr("height", height);

      //Update range
      x.range([0, width]);
      x2.range([0, width]);
      y.range([height, 0]);
      y2.range([height2, 0]);

      yAxis.innerTickSize(-width).outerTickSize(0).tickPadding(10);
      
      update();
    }

    scope.$watch('data', update);

    function update(){
      var color = d3.scale.category10();

      if(!scope.data){ return;}

      if (data.type === 'absolute'){
        format = d3.format(",.0f");
      } else {
        format = d3.format(".0%");
      }

      yAxis.tickFormat(format);

      var series = scope.data.series;
      //Update domain
      var firstSeries = series[0];

      x.domain(d3.extent(firstSeries.posts.map(function(d) { return d.date_time; })));
      y.domain([d3.min(series, function(s) { return d3.min(s.posts, function(p) { return p.posts_count;});} ), 
               d3.max(series, function(s) { return d3.max(s.posts, function(p) { return p.posts_count;});} )]);
      x2.domain(x.domain());
      y2.domain(y.domain());

      //Clean up old data
      svg.selectAll('.series').remove();

      var seriesLine = lineG
          .data(series)
        .enter().append("g")
          .attr("class", "series");

      seriesLine.append("path")
        .attr("class", "line")
        .attr("d", function(d) { return line(d.posts); })
        .style("stroke", function(d) { return color(d.keyword); });

      var seriesLine2 = line2G
          .data(series)
        .enter().append("g")
          .attr("class", "series");

      seriesLine2.append("path")
        .attr("class", "line")
        .attr("d", function(d) { return line2(d.posts); })
        .style("stroke", function(d) { return color(d.keyword); });

      rect.attr("y", -6)
        .attr("height", height2 + 7);

      //Redraw axis
      xAxisG
        .attr("transform", "translate(0," + height + ")")
        .call(xAxis);
      yAxisG.call(yAxis);
      xAxis2G       
        .attr("transform", "translate(0," + height2 + ")")
        .call(xAxis2);

      var legend = focus.selectAll(".legend");
      legend.remove();

      legend = focus.selectAll(".legend")
        .data(color.domain())
      .enter().append("g")
        .attr("class", "legend")
        .attr("transform", function(d, i) { return "translate(0," + i * 20 + ")"; });

      legend.append("rect")
        .attr("x", width - 18)
        .attr("width", 18)
        .attr("height", 18)
        .style("fill", color);

      legend.append("text")
        .attr("x", width - 24)
        .attr("y", 9)
        .attr("dy", ".35em")
        .style("text-anchor", "end")
        .style("font-size", "13px")
        .text(function(d) { return d;});

      svg.select(".title").remove();
      svg.append("text")
        .attr("class", "title")
        .attr("x", (width / 2))             
        .attr("y", 20)
        .attr("text-anchor", "middle")  
        .style("font-size", "14px")
        .text("Proportion of Posts");

      brush.extent(d3.extent(firstSeries.posts.map(function(d) { return d.date_time; })));
      svg.select(".brush").call(brush);
      brushed();

      svg.selectAll(".resize").append("path")
      .attr("class", "handle")
      .attr("transform", "translate(0," +  45 / 2 + ")")
      .attr("d", arc);
    }

    function brushed() {
      //Update the scale of x
      x.domain(brush.empty() ? x2.domain() : brush.extent());
      //Update the area graph
      focus.selectAll(".line").attr("d", function(d) { return line(d.posts); });
      //Update the x axis
      focus.select(".x.axis").call(xAxis);
    }

  }
  return {
    link: link,
    restrict: 'E',
    scope: { data: '=', curSpike: '='}
  };
});
app.directive('postsSingle', function(){
  function link(scope, el, attr){
    el = el[0];
    var margin = {top: 50, right: 10, bottom: 100, left: 50},
      margin2 = {top: 330, right: 10, bottom: 20, left: 50};

    var width, height, height2, cW, cH;

    var svg = d3.select(el).append('svg');

    var x = d3.time.scale(),
        x2 = d3.time.scale(),
        y = d3.scale.linear(),
        y2 = d3.scale.linear();

    var format;

    var xAxis = d3.svg.axis().scale(x).orient("bottom"),
      xAxis2 = d3.svg.axis().scale(x2).orient("bottom"),
      yAxis = d3.svg.axis().scale(y).orient("left");

    var area = d3.svg.area()
      .interpolate("monotone")
      .x(function(d) { return x(d.date_time);})
      .y1(function(d) { return y(d.posts_count); });

    var area2 = d3.svg.area()
      .interpolate("monotone")
      .x(function(d) { return x2(d.date_time); })
      .y1(function(d) { return y2(d.posts_count); });

    var brush = d3.svg.brush()
      .x(x2)
      .on("brush", brushed);

    var focus = svg.append("g")
      .attr("class", "focus")
      .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

    var areaG = focus.append("path");

    var xAxisG = focus.append("g")
        .attr("class", "x axis");

    var yAxisG = focus.append("g")
        .attr("class", "y axis");

    var context = svg.append("g")
      .attr("class", "context")
      .attr("transform", "translate(" + margin2.left + "," + margin2.top + ")");

    var area2G = context.append("path");

    var xAxis2G = context.append("g")
        .attr("class", "x axis");

    var clip = svg.append("defs").append("clipPath")
      .attr("id", "clip")
      .append("rect");

    var rect = context.append("g")
        .attr("class", "x brush")
        .call(brush)
      .selectAll("rect");

    var eventMarkersArea = focus.append("g")
      .attr("class", "eventMarkersArea");
      
    var arc = d3.svg.arc()
        .outerRadius(15 / 2)
        .startAngle(0)
        .endAngle(function(d, i) { return i ? -Math.PI : Math.PI; });

    scope.$watch(function(){ 
      cH = el.clientHeight;
      cW = el.clientWidth;

      width = cW - margin.left - margin.right;
      height = cH - margin.top - margin.bottom;
      height2 = cH - margin2.top - margin2.bottom;

      return cW + cH;
    }, resize);

    function resize(){
      //Resize SVG element
      svg
        .attr("width", cW)
        .attr("height", cH);

      clip
        .attr("width", width)
        .attr("height", height);
        
      //Resize area charts
      area.y0(height);
      area2.y0(height2);

      //Update range
      x.range([0, width]);
      x2.range([0, width]);
      y.range([height, 0]);
      y2.range([height2, 0]);

      yAxis.innerTickSize(-width).outerTickSize(0).tickPadding(10);

      update();
    }

    scope.$watch('data', update);

    function update(){
      if(!scope.data){ return;}

      if (data.type === 'absolute'){
        format = d3.format(",.0f");
      } else {
        format = d3.format(".0%");
      }

      yAxis.tickFormat(format);

      var keyword = scope.data.series[0].keyword;
      var posts = scope.data.series[0].posts;
      var spikes = scope.data.series[0].spikes;

      //Update domain
      x.domain(d3.extent(posts.map(function(d) { return d.date_time; })));
      y.domain([0, d3.max(posts.map(function(d) { return d.posts_count; }))]);
      x2.domain(x.domain());
      y2.domain(y.domain());

      //Add data to to focus area
      areaG.datum(posts)
        .attr("class", "area")
        .attr("d", area);

      //Add data to context area
      area2G.datum(posts)
        .attr("class", "area")
        .attr("d", area2);

      rect.attr("y", -6)
        .attr("height", height2 + 7);

      //Update markers
      updateMarkers();

      //Redraw axis
      xAxisG
        .attr("transform", "translate(0," + height + ")")
        .call(xAxis);
      yAxisG.call(yAxis);
      xAxis2G       
        .attr("transform", "translate(0," + height2 + ")")
        .call(xAxis2);

      var title;

      if (keyword === '_all'){
        title = 'Number of Total Posts Per Day';
      } else {
        title = 'Proportion of Posts with' + ' "'+ keyword + '" ' + 'Per Day';
      }

      svg.select(".title").remove();
      svg.append("text")
        .attr("class", "title")
        .attr("x", (width / 2))             
        .attr("y", 20)
        .attr("text-anchor", "middle")  
        .style("font-size", "14px")
        .text(title);

      brush.extent(d3.extent(posts.map(function(d) { return d.date_time; })));
      svg.select(".brush").call(brush);
      brushed();

      svg.selectAll(".resize").append("path")
      .attr("class", "handle")
      .attr("transform", "translate(0," +  45 / 2 + ")")
      .attr("d", arc);
    }

    function updateMarkers(){
      if(!scope.data){ return;}
      var spikes = scope.data.series[0].spikes;
      //Select all existing makers
      var eventMarkers = eventMarkersArea.selectAll('.event-marker');
      //Remove them from svg
      eventMarkers.remove();
      //Add data to empty selection of markers
      eventMarkers = eventMarkersArea.selectAll('.event-marker');
      eventMarkers = eventMarkers.data(spikes);

      eventMarkers.enter().append("g")
        .attr("class", "event-marker")
        .on("mouseover", function(d){
          scope.curSpike = d.date_time;
          scope.$apply();
        });

      //Draw the event markers
      eventMarkers.append('line')
        .attr("x1", function(d) { return x(d.date_time); })  
        .attr("x2", function(d) { return x(d.date_time); })        
        .attr("y1", function(d) { return y(d.posts_count); })
        .attr("y2", function(d) { return 0 + y(d.posts_count) - 20; })     
        .attr("stroke-width", 1.5)
        .style("stroke-dasharray", ("3, 3"))
        .style("stroke", "red")
        .style("fill", "none");

      //Add red circle
      eventMarkers.append('circle')
        .attr("r", 3)
        .attr("cx", function(d) { return x(d.date_time); }) 
        .attr("cy", function(d) { return 0 + y(d.posts_count) - 20; }) 
        .style("fill", "red");
    }

    function brushed() {
      //Update the scale of x
      x.domain(brush.empty() ? x2.domain() : brush.extent());
      //Update the area graph
      focus.select(".area").attr("d", area);
      //Update the x axis
      focus.select(".x.axis").call(xAxis);

      updateMarkers();
    }

  }
  return {
    link: link,
    restrict: 'E',
    scope: { data: '=', curSpike: '='}
  };
});
app.factory('postService', ['$http','$location', function($http,$location) {
  
  //Ghetto way of detecting environment
  var curUrl = $location.absUrl();
  var apiRoot;
  if ((curUrl.indexOf('localhost') > -1) || (curUrl.indexOf('127.0.0.1') > -1)){
    apiRoot = 'http://localhost:5000/';
  } else {
    apiRoot = 'http://openkala.com/';
  }

  var cleanData = function(data){
    var series = data.series;
    var curSeries;
    var curDateTime;

    //For each data series
    for (var i = 0; i < series.length;i++){
      //Clean posts data
      curSeries = series[i];

      for (var j = 0; j < curSeries.posts.length; j++){
        //Get date time of current post
        curDateTime = curSeries.posts[j].date_time;
        //Turn it into date object
        if (!(curDateTime instanceof Date)){
          curSeries.posts[j].date_time = new Date(parseInt(curDateTime));
        }
      }

      for (var k = 0; k < curSeries.spikes.length; k++){
        //Get date time of current spike
        curDateTime = curSeries.spikes[k].date_time;
        //Turn it into date object
        if (!(curDateTime instanceof Date)){
          curSeries.spikes[k].date_time = new Date(parseInt(curDateTime));
        }
      }
    }
    
    return data;
  };

  var getPosts = function(keywords, callback){
    var key_list = keywords.slice().sort();
    var key = key_list.toString();
    if (clientCache[key]){
      rawData = clientCache[key];
      data = cleanData(rawData);
      callback(data);
    }
    else{
      var keywordsStr = keywords.join(',');
      var requestUrl = apiRoot + 'pantip?keyword=' + keywordsStr;
      $http.get(requestUrl).
        success(function(rawData, status, headers, config) {
          clientCache[key] = rawData;
          data = cleanData(rawData);
          callback(data);
        });
      }
    };
  return {getPosts : getPosts};
  
}]);